import { Stethoscope, Users, CalendarDays, FileText } from "lucide-react";

const menuItems = [
  { label: "Doctors", icon: Stethoscope },
  { label: "Patients", icon: Users },
  { label: "Appointments", icon: CalendarDays },
  { label: "Prescriptions", icon: FileText },
];

export default function Sidebar() {
  return (
    <aside className="w-64 bg-gray-900 text-gray-100 min-h-screen p-5 hidden md:block">
      <h2 className="text-lg font-semibold text-gray-300 mb-6 tracking-wide">
        Menu
      </h2>
      <ul className="space-y-4">
        {menuItems.map(({ label, icon: Icon }) => (
          <li
            key={label}
            className="flex items-center gap-3 px-3 py-2 rounded-lg cursor-pointer hover:bg-gray-700 hover:text-blue-400 transition"
          >
            <Icon className="w-5 h-5" />
            <span className="font-medium">{label}</span>
          </li>
        ))}
      </ul>
    </aside>
  );
}
